import React from "react";

import "./Hero.css";

function Hero() {
    return(
        <div class="container">
            <h1 class="display-4">Fluid jumbotron</h1>
            <p>This is a modified jumbotron that occupies the entire horizontal space of its parent.</p>
        </div>
    );
}

export default Hero;
